import React from 'react';
import UserProfile from '../../components/UserProfile';
import './Profile.css';

const Profile = () => {
  return (
    <div className="profile-page">
      <h2>Your Profile</h2>
      <UserProfile />
    </div>
  );
};

export default Profile;
